src/utils/env.ts.content:
import process from "node:process";

import { parseEnvValue } from "./functions/parseEnvValue.js";

export const discordToken = process.env.DISCORD_TOKEN;
export const channelsId: string[] = parseEnvValue(process.env.CHANNELS_ID ?? "");
export const webhooksUrl: string[] = parseEnvValue(process.env.WEBHOOKS_URL ?? "");

export const enableBotIndicator: boolean = process.env.ENABLE_BOT_INDICATOR?.toLowerCase() === "yes";
export const useWebhookProfile: boolean = process.env.USE_WEBHOOK_PROFILE?.toLowerCase() === "yes";
export const debugMode: boolean = process.env.DEBUG_MODE?.toLowerCase() === "yes";

export const headers = {
    "Content-Type": "application/json",
    Authorization: `Bot ${discordToken}`
};

src/typings/index.ts.content:
/* eslint-disable typescript/naming-convention */
import type { APIEmbed, Snowflake } from "discord.js";

export type Channel = {
    id: Snowflake;
    type: number;
    guild_id?: Snowflake;
    position: string;
    permission_overwrites?: Overwrite[];
    name: string;
    topic?: string;
    nsfw?: boolean;
    last_message_id?: Snowflake;
    reate_limit_per_user?: number;
    parent_id?: Snowflake;
}

export type Overwrite = {
    id: string;
    type: number;
    allow: string;
    deny: string;
}

export type Things = {
    avatarURL: string;
    content: any;
    embeds?: APIEmbed[];
    files?: any[];
    url: string;
    username: string;
}

export type WebhookConfig = {
    things: Things;
}

export type WebsocketTypes = {
    on(event: string, cb: (data: any) => void): void;
    send(data: any): void;
}

export type DiscordWebhook = {
    application_id: Snowflake | null;
    avatar: string | null;
    channel_id: Snowflake;
    guild_id: Snowflake;
    id: Snowflake;
    name: string;
    token: string;
    url: string;
}

src/utils/functions/parseEnvValue.ts.content:
export function parseEnvValue(str: string): string[] {
    return (
        str
            .match(/(?<=(?:\s+|^))(?<str>["'])?.*?\k<str>(?=(?:[,;]|(?:(?:\s+)?$)))/gu)
            ?.filter(x => Boolean(x.trim()))
            .map(x => ((x.startsWith("'") && x.endsWith("'")) || (x.startsWith('"') && x.endsWith('"')) ? x.slice(1, -1) : x)) ??
        []
    );
}

